const mutations = {
  SET_PROPERITES(state, payload) {
    state.properties = payload.property;
  },
  SET_JOBS(state, payload) {
    state.allJobs = payload.data;
  },
  SET_ESTIMATES(state, payload) {
    state.estimates = payload.data;
  },
  SET_CONTACTS
};
export default mutations;
